import React, { useState } from 'react';
import Welcome from './Welcome';
import Wip from './Wip';
import Links from './Links';
import Project from './Project';

function App() {

  const [projects] = useState([
    { name: "Tic Tac Toe", description: "Fun game to play!"},
    { name: "Flappy Bird", description: "Old game that's so fun!"},
    { name: "Github", description: "Code sharing website!"}
  ]);

  return (
    <div className="app">
      <div id="firstbreak"></div>
      <text id="name">Julian Coronado</text>
      <div className="break"></div>
      <div className="main">
        { /* Center Items on Main page */}
        <Welcome />
        <div className="break"></div>
        <div id="projdiv">
          {projects.map(project => (
            <Project name={project.name} description={project.description} />
          ))}
        </div>
        <div className="break"></div>
        <Wip />
        <div className="break"></div>
        <Links />
      </div>
    </div>
  );
}

export default App;
